import React, { useState } from "react";
import "./App.css";

const App = () => {
  const yearsSelect = [
    2003,
    2004,
    2005,
    2006,
    2007,
    2008,
    2009,
    2010,
    2011,
    2012,
    2013,
    2014,
    2015
  ];
  const [yearSelected, setYearSelected] = useState();

  return (
    <div className="App">
      <div className="header">
        <div className="title">Campeonato Brasileiro</div>
        <div className="select">
          <select>
            {yearsSelect.map(year => {
              return <option value={year}>{year}</option>;
            })}
          </select>
        </div>
      </div>
    </div>
  );
};

export default App;
